import React from 'react';
import './homePic.css'
function HomePic() {
  return (
   <div className='pic-wrap'>
    <div className='left'>
        <div className='intro-text'>
            <div className='intro-title'>Matching you with your dream apartment</div>
            <p>We match you with living spaces tailored to your wants and needs</p>
        </div>
        <div className='intro-button-wrap'>
            <div className='intro-button'>How to Get Started</div>
            <div className='intro-button'>Sign Up</div>
        </div>
    </div>
    <div className='right'>
        <div className='main-picture'></div>
    </div>
   </div>
  );
}

export default HomePic;
